import React from 'react'
import { Copyright } from '@mui/icons-material';
import './Index.css'

const Index = () => {

    const year = new Date().getFullYear();
  return (
    <div>
       <span><h4> Copyright</h4> <Copyright/> <span></span><h4>{year}</h4></span>
    </div>
  )
}

export default Index
